import React from 'react';
import {Row, Col} from 'reactstrap';

export default class Skills extends React.Component {
    constructor(props) {
        super (props);

        this.state = {
            skills: props.skills === null ? [] : props.skills
        }
    }

    renderChildren(skills) {
        {skills.map((skill, skillKey) => (
            <li key={skillKey}>{skill.skill}</li>
        ))}
    }

    render () {

        let content = this.state.skills.length > -1 ? (
            <Row tag="section">
                {this.state.skills.map((skillSet, setKey) => (
                    <Col md="4" key={setKey}>
                        <h4>{skillSet.title}</h4>
                        <ul>
                            {renderChildren(skillSet.skills)}
                        </ul>
                    </Col>
                ))}
            </Row>
        ) : "";

        return (
            {content}
        )
    }
}
